import React from 'react'
import {BrowserRouter} from 'react-router-dom'
import Excersises from '../pages/Exercises';
import ExcersisesNew from '../pages/ExercisesNew';
function App(){
    return(
        <BrowserRouter>
            <Route path="/excercise" component={Excersises} />
            <Route path="/excercise/new" component={ExcersisesNew} />
        </BrowserRouter>
    )
}

export default App
